import React, { Component } from "react";
import { Button, Table } from "semantic-ui-react";
import Layout from "../../components/Layout";
import MailRow from "../../components/List/MailRow";

class MailList extends Component {

  renderRow() {
    return (
      <MailRow/>
    );
  }


  render() {
    const { Header, Row, HeaderCell, Body } = Table;
    return (
      <Layout>
        <Button basic color="violet" floated="left" style={{marginBottom: '10px'}} >
          택배 접수
        </Button>
          <Table >
            <Header>
              <Row>
                <HeaderCell colSpan='1'>받는 사람</HeaderCell>
                <HeaderCell colSpan='1'>주소</HeaderCell>
                <HeaderCell>연락처</HeaderCell>
                <HeaderCell>상품명</HeaderCell>
                <HeaderCell>배송 상태</HeaderCell>
                <HeaderCell>QR코드</HeaderCell>
              </Row>
            </Header>
            {this.renderRow()}
          </Table>
      </Layout>
    );
  }
}

export default MailList;
